const canvas = document.getElementById('canvas1');
const ctx = canvas.getContext('2d'); //canvas is given 2d context e.g. ctx fille drect

canvas.width = 960;
canvas.height = 540;

const image1 = new Image(); //new creates image object with src properties
//image1.src = 'image1.png';  //CORS (CROSS ORIGIN) SECURITY PROBLEM WITH IMAGES, CHANGE IMAGE TO DATA STRING TO AVOID PROBLEMS TODATAURL();
image1.src = 'data:image/png;base64,';
image1.addEventListener('load', function(){ //JS is fast and much constantly listen cos it will run the image then finish up, whereas this keeps it going forever
  ctx.drawImage(image1, 0, 0, canvas.width, canvas.height); //draws image, chooses position, xy scale
  const scannedImage = ctx.getImageData(0, 0, canvas.width, canvas.height);
  console.log(scannedImage);
  const scannedData = scannedImage.data;
  for (let i = 0; i < scannedData.length; i += 4){
    const total = scannedData[i] + scannedData[i+1] + scannedData[i+2];
    const averageColourValue = total/3;
    scannedData[i] = averageColourValue;
    scannedData[i+1] = averageColourValue;
    scannedData[i+2] = averageColourValue;
  }
  scannedImage.data = scannedData;
  ctx.putImageData(scannedImage, 0, 0)
})
